def visitedStreets(M, nbList, cars_list, streets_name, paths):
  visited_streets = {}
  for car in cars_list:
    for street in paths[car[0]][1:]:
      visited_streets[street] = visited_streets.get(street, 0) + 1
  return visited_streets

